script: |
  super -f text -I q13127.spq | sort > q13127.out

inputs:
  - name: q13127.spq
    data: |
      SELECT col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + 36 * - col2 NOT BETWEEN ( + col1 ) AND ( + 18 );
  - name: tab0

outputs:
  - name: q13127.out
    data: |
      1
      21
      81
